import React from 'react';
import '../../App.scss';
import './Join.scss';

export default function Join() {
  return (
    <div className="App">
      <div className="join__wrapper">
        <h1 className="join__left">Who's playing?</h1>

        <div className="join__right">
          <h4>Connect now to the site, and use the code: </h4>
          <div>AB12</div>
        </div>
      </div>

      <div className="player__wrapper">
        <div className="player__number">Player 1</div>
        <div className="player__name">Adam</div>
      </div>  

      <button>Everyone's here! Let's do this!</button>
    </div>
  );
}
